                <img src="dente.png" alt="dente"/>
                <h1>Dentes Saud√°veis</h1>
            </div>
            <div className="boxLink">
            <Link className="topo-link" to="/">Home</Link>
          <Link className="topo-link" to="/contato">Contato</Link>

            </div>
        </header>
    );
}
export default Topo;
